import React, { Component, useState, useEffect } from "react";
import axios from "axios";
import { Card, Button, Space, List, Avatar } from "antd";
import { Link } from "react-router-dom";
import ArticleNavgation from "./NavComponents/articleNav";
import Header from "./NavComponents/navigation";
import PostForm from "./components/postForm";

const Articles = (props) => {

  const IconText = ({ icon, text }) => (
      <Space>
          {React.createElement(icon)}
          {text}
      </Space>
  );


  return (
      <div>
          <List
              itemLayout="vertical"
              size="large"
              pagination={{
                  onChange: page => {
                      console.log(page);
                  },
                  pageSize: 3,
              }}
              dataSource={props.data}

              renderItem={item => (
                  <List.Item
                      key={item.title}
                      actions={[
                          <IconText text="156" key="list-vertical-star-o" />,
                          <IconText text="156" key="list-vertical-like-o" />,
                          <IconText text="2" key="list-vertical-message" />,
                      ]}
                      extra={
                          <img
                              width={272}
                              alt="logo"
                              src="https://gw.alipayobjects.com/zos/rmsportal/mqaQswcyDLcXyDKnZfES.png"
                          />
                      }
                  >
                      <List.Item.Meta
                          avatar={<Avatar src={item.avatar} />}
                          title={<a href={`/${item.id}`}>{item.title}</a>}
                          description={item.description}
                      />
                      {item.content}
                  </List.Item>
              )}
          />
      </div>
  );
}

